// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

import { ERC1155 } from "./ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract NIMANYGoldPass is ERC1155, Ownable {

  address public NIMANY721Address;

  string public name = "NIMANY VIP pass";
  string public symbol = "NVP";


  function uri(uint256) public pure virtual override returns (string memory) {
    return "ipfs://QmPa7gm3RZSnPvw4L8wdMCLwgh2pATC1WJe43RinDNd74x/0";
  }

  function mint(
      address to,
      uint256 id,
      uint256 amount,
      bytes memory data
  ) public virtual {
      _mint(to, id, amount, data);
  }

  function setContractUri(address newAddress) public onlyOwner {
    NIMANY721Address = newAddress;
  }

  function realmint(
      address to,
      uint256 id,
      uint256 amount,
      bytes memory data
  ) public virtual {
      if (msg.sender == NIMANY721Address) {
        _mint(to, id, amount, data);
      } else {
        revert("Only callable by NIMANYClubWatches contract.");
      }
  }
}
